import { Navbar, Container, Row, Col, Image, Nav } from 'react-bootstrap';
import Link from 'next/link';

function NavbarDesktop(props) {
  return (
    <div className="bg-white shadow-sm fixed-top">
      <Container>
        <Row>
          <Col>
            <Navbar bg="white" expand="lg" className="pl-0 pr-0">
              {/* <Link href="!#">
                <a className="">
                  <Image fluid src="./static/images/logo.png" />
                </a>
              </Link> */}
              <Navbar.Brand href="#home">
                  <Image fluid src="./static/images/logo.png" />
              </Navbar.Brand>
              <Nav className="ml-auto">
                <Nav.Link href="#home">All Service</Nav.Link>
                <Nav.Link href="#link">Login</Nav.Link>
              </Nav>
            </Navbar>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default NavbarDesktop;
